import React from 'react';
import { Card } from 'antd';
import './App.css';

class SuggestionsCard extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            amount: 0.0,
            exchange: 0.0
          };
      }

    componentDidMount() {
        const req = new Request(this.props.url, {
            method: 'GET',
            cache: 'default'
          });
    fetch(req,
    {
        headers : { 
          'Content-Type': 'application/json',
          'Accept': 'application/json'
         }

      })
      .then((response) => {
          return response.clone().json()
        }
          )
      .then((data) => {
        this.setState({
            amount: data["amount"],
            exchange: data["exchange"]
            });
        })

    }

    render() {
        const { amount, exchange } = this.state

            return (
            <div className="insideCard">
                <Card title={this.props.type}>
                    <p>
                    <b>Exchange:</b>{exchange}
                    <br />
                    <b>Price:</b>{amount} 
                    <br />
                    </p>
                </Card>
            </div>
            );
            }
    }

export default SuggestionsCard;
